import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="img-container">
        <img src="./background-pattern-desktop.svg" alt="" />
        <img src={logo} className="App-logo" alt="logo" />
      </div>
    </div>
  );
}

export default App;
